import React from 'react' 
import './hotel.css'


class Caracteristicas extends React.Component{  
   
    render() {
        return(
            <div>

                {
                    this.props.datosHotel.map(  
                        (objeto) => {

                            return(
                                 <p>
                               
                    
                             {objeto.caracteristicas}
                    
                            </p>
                            )
                            
                           
                        }
                     ) 
                      
                }

            </div>    
        )
    }
}

export default Caracteristicas
